import './Logout.css';
import { IoIosPower } from 'react-icons/io';

// Export Logout view
export default function ReturnLogout() {
 return (
  <div className='wrp-logout-dash'>
   <IoIosPower size={'1.2em'} color='#e91e63' />
   <h2>logout</h2>
  </div>
 );
};
